import React, { Component } from 'react'

export default class Historia extends Component {
    render() {
        return (
            <div class="carousel-item col-3 active m-0 p-1">
                <div className="card bg-darktext-white border-0 historia text-white">
                    <img className="card-img img-fluid center-block" src="https://i.pinimg.com/originals/e3/6f/59/e36f59a2482ed2c4bbb0a839a0bca377.jpg" alt="" />
                    <div className="card-overlay h-100 d-flex flex-column justify-content-end">
                        <div class="bg-transparent border-0 p-1 align-text-bottom"><small className=" p-0 m-0">Gabriela Astudillo</small></div>

                    </div>

                </div>
            </div>

        )
    }
}
